    "ground-penetrating-radar-gpr-trackline-locations-collected-from-dauphin-island-alabama-in-2013",nt"isopen":
    false,nt"url": null,nt"notes": "From April 13-20, 2013, scientists from
    the U.S. Geological Survey St. Petersburg Coastal and Marine Science Center (USGS-SPCMSC)
    conducted geophysical surveys and collected sediment samples from Dauphin Island,
    Alabama. This dataset, Ground Penetrating Radar (GPR) Trackline Locations Collected
    from Dauphin Island, Alabama, in April 2013, contains geospatial data and raster
    images of the GPR data. The GPR trackline locations are presented as Geographic
    Information System (GIS) files and the subsurface profile data are provided as images
    in Joint Photographic Experts Group (JPEG) format.",nt"license_title": null,nt"extras":
